// DamagedHairProducts.js

import React from 'react';
import Header from './Header';
import './Products.css';

const damagedHairProducts = [
  { id: 5, name: 'Product5', price: '$19.99', image: '/product5.png', reviews: '4.2/5', category: 'category1' },
  { id: 6, name: 'Product6', price: '$29.99', image: '/product6.png', reviews: '4.5/5', category: 'category2' },
  { id: 7, name: 'Product7', price: '$24.99', image: '/product7.png', reviews: '4.1/5', category: 'category3' },
  { id: 8, name: 'Product8', price: '$14.99', image: '/product8.png', reviews: '4.3/5', category: 'category4' },
  { id: 21, name: 'Product21', price: '$39.99', image: '/product21.png', reviews: '4.7/5', category: 'category5' },
  { id: 22, name: 'Product22', price: '$49.99', image: '/product22.png', reviews: '4.8/5', category: 'category6' },
  { id: 23, name: 'Product23', price: '$34.99', image: '/product23.png', reviews: '4.6/5', category: 'category7' },
  { id: 24, name: 'Product24', price: '$19.99', image: '/product24.png', reviews: '4.4/5', category: 'category8' },
  { id: 39, name: 'Product39', price: '$29.99', image: '/product39.png', reviews: '4.5/5', category: 'category9' },
  { id: 40, name: 'Product40', price: '$19.99', image: '/product40.png', reviews: '4.2/5', category: 'category10' },
];

function DamagedHairProducts({ navigateTo }) {
  return (
    <div className="products">
      <Header navigateTo={navigateTo} />

      <div className="products-content">
        <h2>Damaged Hair Products</h2>

        <div className="products-grid">
          {damagedHairProducts.map((product) => (
            <div key={product.id} className="product-item" onClick={() => navigateTo(`product${product.id}`)}>
              <img src={product.image} alt={product.name} className="product-image" />
              <div className="product-details">
                <h3>{product.name}</h3>
                <p className="product-price">{product.price}</p>
                <p className="product-reviews">Reviews: {product.reviews}</p>
                <button className="add-to-cart-btn">ADD TO CART</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default DamagedHairProducts;
